import './App.css';
import PrimButton from './Components/Button'
import {  BrowserRouter as Router ,Switch, Route} from "react-router-dom";
import { Link } from "react-router-dom";

import LoginPage from './Views/LoginPage'
import MemberRegistration from './Views/MemberRegistration'
import SignUpPage from './Views/SignUpPage'
import { ListItem } from '@material-ui/core';



function App() {
  return (
    <div className="App">
    <Router>
      <PrimButton message="HAWT"/>


      <ul  >
            <li><Link to="/" >LoginPage</Link></li>
            <li><Link to="/MemberRegistration" >About</Link></li>            
      </ul>

      <Switch>
        <Route exact path = "/LoginPage" >
            <LoginPage />             
        </Route>
        <Route path = "/MemberRegistration" >
            <MemberRegistration/>
        </Route>
        <Route path = "/SignUpPage">
            <SignUpPage/>
        </Route>
      </Switch>
      </Router>

    </div>
  );
}

export default App;
